import React, { Component } from 'react'

class TodoList extends Component {
  render() {
    let todos = this.props.todos.map( todo => {
      return <Todo task={todo.content} />
    })
    return (
      <div>
        {todos}
      </div>
    )
  }
}

export default TodoList
